import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Notes from "./Notes";
import Note from "./components/Note";

function newNotes(nDetail) {
  return (
    <Note
      nkey={nDetail.key}
      nTitle={nDetail.title}
      nContent={nDetail.content}
    />
  );
}

function App() {
  return (
    <div>
      <Header />
      {Notes.map(function newNotes(nDetail) {
        return (
          <Note
            nkey={nDetail.key}
            nTitle={nDetail.title}
            nContent={nDetail.content}
          />
        );
      })}
      <Footer />
    </div>
  );
}
export default App;
